import "./attribute.css";

function Attribute() {

 return <div className="attr">
            <p>צורה</p>
            <p>אורך (ס"מ)</p>
            <p>קוטר (מ"מ)</p>
            <p>כמות (יחי')</p>
        </div>
}

export default Attribute;
